                <p> Dirección: Calle Los Nardos N° 64, Urb. Pescaserolli</br>
                    Directora: Dra. Silvia Sakuray Montalvo</br>
                    Correo Electrónico: silviasakuray@gmail.com</br></p>

                <p> La Dirección Ejecutiva de Salud de las Personas de la Dirección Regional de Salud Tacna,a cargo de la Dra. SILVIA SAKURAY MONTALVO, tiene por función básica garantizar el cumplimiento de normas y procesos referidos a la protección, recuperación y rehabilitación de salud de las personas con enfoque integral y calidad, así como la organización y funcionamiento de los Servicios de Salud proponiendo normas complementarias en base a la política nacional de Salud y aseguramiento. Para ello cuenta con el personal profesional y Técnico capacitado en sus diferentes Direcciones.
                </p>
                <p> Cuenta con tres equipos de trabajo:</p>

                <p> EQUIPO DE TRABAJO DE SERVICIOS DE SALUD</p>
                <p> Encargado de propiciar la adecuada organización y funcionamiento de los servicios de salud públicos y privados.</p>

                <p> EQUIPO DE TRABAJO DE SEGUROS</p>
                <p> Encargado de coordinar, organizar, y brindar asistencia técnica en el desarrollo de las actividades de Aseguramiento en Seguros de Salud y Convenios de Salud. A cargo de: Lic. Obs. Angel Rojas Urrieta</p>

                <p> EQUIPO DE TRABAJO DE ATENCIÓN INTEGRAL Y CALIDAD EN SALUD</p>
                <p> Programa, ejecuta, coordina, supervisa, asesora y evalúa el desarrollo de acciones, proyectos y procesos de prestación, organización y gestión de la atención integral de salud, según las necesidades de salud (protección, recuperación y rehabilitación) del niño, adolescente, adulto, adulto mayor y/o de la estrategia sanitaria a su cargo, con enfoque de calidad.</p>
